def io_bound_task(): print("Task start") time.sleep(2) # Simulate an I/O operation print("Task complete") start_time = time.time()
threads = []
for _ in range(2): # Create 2 threads thread = threading.Thread(target=io_bound_task) thread.start() threads.append(thread) for thread in threads: thread.join() end_time = time.time()
